import React from 'react';


const SearchBox = (searchChange) => {

	return (
		<div className='pad2'>
			<input className='pad5 ' 
					type='search' 
					placeholder='search robots' 
					OnSearchChange={searchChange}/>
		</div>
		);
}
export default SearchBox;
